(10007, 'Tabs GK4', 'module', 'mod_tabs_gk4', '', 0, 1, 0, 0, '{"legacy":false,"name":"Tabs GK4","type":"module","creationDate":"20\\/02\\/2012","author":"GavickPro","copyright":"Copyright (C) 2011-2012 GavickPro. All rights reserved.","authorEmail":"info@gavick.com","authorUrl":"www.gavickpro.com","version":"GK4 1.7","description":"\\n\\t\\t<style type=\\"text\\/css\\">\\n\\t\\t\\tspan.readonly { padding: 10px; font-family: Arial; font-size:13px !important; font-weight: normal !important; text-align: justify; color: #4d4d4d; line-height: 24px; }\\n\\t\\t\\tspan.readonly h1 { clear:both; font-family: Georgia, sans-serif; font-size:38px; margin:30px 20px 23px; padding:0px 0px 24px 10px; color:#333; border-bottom: 1px solid #eee; font-weight: normal; }\\n\\t\\t\\tspan.readonly p { margin: 0 26px 10px }\\n\\t\\t\\tspan.readonly p a { color: #2F4C6D }\\n\\t\\t\\tspan.readonly p.homepage { margin-top: 30px }\\n\\t\\t\\tspan.readonly p.license { border-top: 1px solid #eee; font-size: 11px; margin: 30px 26px 0; padding: 6px 0; }\\n\\t\\t<\\/style>\\n\\t\\t\\n\\t\\t<span class=\\"readonly\\"><h1>Tabs GK4<small>ver. 1.7<\\/small><\\/h1><p>GK4 is new generation of our extensions dedicated to Joomla 1.6.<\\/p><p>With Tabs GK4 module, you can create tabs on a site which include various content, like: some modules or XHTML code defined by a user. Thanks to tab management system integrated in the module, its support is very easy, intuitive and fast. By embedding <a href=''http:\\/\\/tools.gavick.com\\/newshowpro.html'' target=''_blank''>News Show GK4<\\/a> module in it, it is possible to get a tool for presenting articles in the form of tabs easily.<\\/p> <p class=''homepage''><a href=''http:\\/\\/tools.gavick.com\\/tabs.html'' target=''_blank''>Learn more at the Tabs GK4 project website.<\\/a><\\/p><p class=''license''>Tabs GK4 is released under the <a target=\\"_blank\\" href=\\"http:\\/\\/www.gnu.org\\/licenses\\/gpl-2.0.html\\">GNU\\/GPL v2 license.<\\/a><\\/p><\\/span>\\n\\t