(1, 0, 0, 0, 0, 0, 'Instituto para el Ecodesarrollo de la Región Amazónica', '1660005130001', 'ECORAE', 'PLANIFICAR, EJECUTAR, MONITOREAR Y EVALUAR PROGRAMAS Y PROYECTOS QUE CONTRIBUYAN AL BUEN VIVIR DE LA CIRCUNSCRIPCION TERRITORIAL AMAZONICA CTEA', '010', 'R.O.N.30', '1992-09-21', 'Diseñar y ejecutar una estrategia consensuada con los actores locales, nacionales e internacionales, basada en un sistema de evaluación y rendición de cuentas, para alacanzar el desarrollo humano sustentable de la Región Amazónica  Ecuatoriana.', 'Ser un organismo líder, transparente y participativo que promueva con identidad amazónica el desarrollo humano sustentable de la región, fortaleciendo su integración al país y a la cuenca amazónica, en un marco competitivo y descentralizado.', NULL, NULL, NULL, NULL, 'Resolución de Directorio No. 009, Registro oficial No. 6, 23-01-2003', 1, 0, '0000-00-00'),
