(1, 0, 0, 0, 1, 1, 1, 0, 99, 3, 1, 'Elaboración y puesta en marcha del Plan Estratégico Institucional', 'El proyecto  tiene influencia en toda la Circunscripción Territorial Especial Amazónica –CTEA,  que representa alrededor del  48% del territorio nacional y abarca las provincias de: Sucumbíos,  Orellana, Napo, Pastaza, Morona Santiago y Zamora Chinchipe.', '', '2010-04-01', '2013-12-31', 48, 4, '2012-10-24', '2013-05-07', '40350000.1129.5090', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '1.00000', NULL, NULL, NULL, NULL, 1, 0, '2013-06-26 20:14:40'),
(2, 0, 0, 0, 1, 1, 1, 0, 2, 0, 1, 'Investigación para el Desarrollo de la CTEA', 'Desarrollar y fortalecer los procesos de transferencia de conocimientos, formación de capacidades locales, ciencia tecnología e investigación, para contar con recurso humano calificado y competente en la CTEA.', '', '2010-03-01', '2013-12-31', 46, 4, '2012-10-24', '2013-03-26', '40350000.1129.5094', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '5.00000', NULL, NULL, NULL, NULL, 1, 0, '2013-04-09 20:02:00'),
(3, 0, 0, 0, 1, 1, 1, 0, 100, 3, 1, 'Sistema Institucional de Rendición de Cuentas (Estrategia de comunicación para la CTEA)', 'Desde su creación el ECORAE no cuenta con un sistema dinámico de rendición de cuentas tanto a nivel interno como externo, lo que ocasiona que en varias ocasiones no se pueda medir efectivamente los niveles de impacto del accionar institucional y de los recursos invertidos en la Región Amazónica.  Con la implementación de este proyecto se pretende realizar eventos públicos de rendición de cuentas a todos los actores sociales que intervienen en la Región Amazónica', NULL, '2010-01-13', '2013-12-20', 35, 4, '2012-10-24', '2012-07-27', '40350000.1129.5080', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '5221021.46000', NULL, NULL, NULL, NULL, 1, 0, '2013-07-10 13:45:24'),
(4, 0, 0, 0, 1, 1, 1, 0, 100, 3, 1, 'Desarrollo de un Subsistema de Información de la CTEA articulado al SNI', 'Busca establecer un sistema de información y conectividad para la CTEA que permita la accesabilidad, generación y difusión de información tomando como característica principal el tratamiento especial para la CTEA.  El sistema involucra a todas las provincias de la Región amazónia', NULL, '2010-01-08', '2013-12-06', 47, 4, '2012-10-24', '2012-07-26', '40350000.1129.5085', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '916555.16000', NULL, NULL, NULL, NULL, 1, 0, '2013-03-19 11:06:38'),
(5, 0, 0, 0, 1, 1, 1, 0, 100, 3, 1, 'Plan integral de la CTEA y propuesta para borrador de la Ley', 'LA REGIÓN CUENTA CON UNA GRAN DIVERSIDAD NATURAL, CULTURAL Y SOCIAL QUE REQUIERE DE UNA BUEN VIVIR QUE GARANTICE LA CONSERVACIÓN, PROTECCIÓN Y EL APROVECHAMIENTO SOSTENIBLE DE SUS RECURSOS, LA CUAL DEBE ESTAR ENMARCADA EN UN PLAN INTEGRAL DE LAS PROPUESTAS E INICIATIVAS CONSENSUADAS Y CONCERTADAS QUE POSIBILITE EN EL CORTO, MEDIANO Y LARGO PLAZO, ALCANZAR UN DESARROLLO QUE RECOJA LA HETEROGENEIDAD Y LA GRAN DIVERSIDAD PRODUCTIVA, TECNOLÓGICA, ECOLÓGICA, SOCIAL Y CULTURAL DE LA REGIÓN BAJO ESTRATEGIAS Y POLÍTICAS ECONÓMICAS DIFERENCIADAS, LAS CUALES DEBEN GUARDAR COHERENCIA Y LÓGICA INTERNAS Y NACIONALES.\nEL ECORAE EN CUMPLIMIENTO DE UNO DE LOS MANDATOS DE SU LEY Y REGLAMENTO CONSTITUTIVOS, EN 1998 PUSO EN VIGENCIA EL PLAN MAESTRO PARA EL ECODESARROLLO DE LA REGIÓN AMAZÓNICA ECUATORIANA, EL CUAL HA SIDO EJECUTADO EN PARTE Y NO SE HA REALIZADO UN PROCESO DE CONSENSO Y CONCERTACIÓN PARA IMPLEMENTAR LAS DIFERENTES PROPUESTAS CONTENIDAS EN LAS DIMENSIONES Y ÁREAS ESTRATÉGICAS DEL MISMO, ASÍ COMO NO SE HA EFECTUADO LA EVALUACIÓN Y MONITOREO DE LOS IMPACTOS Y RESULTADOS EN LA REGIÓN Y SU ACTUALIZACIÓN PERIÓDICA INTERVENCIÓN INTEGRAL Y ARTICULADA AL PLAN NACIONAL PARA EL', NULL, '2010-01-08', '2013-12-07', 47, 4, '2012-10-24', '2012-07-26', '40350000.1129.5091', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '16186656.44000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(6, 0, 0, 0, 1, 2, 3, 0, 7, NULL, 1, 'Mejoramiento y ampliación de la cobertura del servicio de salud ambulatoria', 'EL PROYECTO CONSISTE EN QUE EL ECORAE FINANCIARÁ LA MOVILIZACIÓN DE LOS EQUIPOS BÁSICOS DE ATENCIÓN EN SALUD ¿EBAS DEL MINISTERIO DE SALUD PÚBLICA ¿MSP, EN CADA PROVINCIA, QUIENES APLICARÁN PROGRAMAS DE PREVENCIÓN, SOCIALIZACIÓN Y CURACIÓN AMAZÓNICA, PARA APOYAR Y AMPLIAR LOS DIVERSOS SERVICIOS DE SALUD DE ATENCIÓN DE EMERGENCIAS. ', NULL, '2010-01-04', '2013-12-07', 48, 4, '2012-10-24', '2012-07-27', '40350000.1130.5080', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '1597754.67000', NULL, NULL, NULL, NULL, 1, 0, '2013-03-21 09:06:50'),
(7, 0, 0, 0, 1, 2, 4, 0, 7, 0, 1, 'Apoyo al desarrollo y mejoramiento del transporte fluvial (Dotación de canoas y deslizadores)', 'EL PROYECTO CONSISTE EN DOTAR DE CANOAS Y DESLIZADORES AL MINISTERIO DE SALUD PÚBLICA, PARA EL TRASLADO DE LOS EQUIPOS BÁSICOS DE ATENCIÓN EN SALUD -EBAS,  EMERGENCIAS MÉDICAS Y ACCIÓN CÍVICA DE TRANSPORTE DE PRODUCTOS PARA SU COMERCIALIZACIÓN EN LOS MERCADOS DE LAS CABECERAS CANTONALES. LAS CARACTERÍSTICAS DEL TRANSPORTE FLUVIAL SERÁ TRABAJAR CON UN SISTEMA COMBINADO (TRASLADO ENFERMOS, EBAS Y ACCIÓN CÍVICA) DEPENDIENDO DE LAS DISTANCIAS ENTRE COMUNIDADES, CONDICIONES DE CLIMA Y SIN COSTO. EL SERVICIO ESTÁ ORIENTADO A LA POBLACIÓN DE EXTREMA POBREZA DE LAS COMUNIDADES RURALES UBICADAS EN LAS RIVERAS DE LOS RÍOS DE LAS CINCO PROVINCIAS DE LA CTEA', NULL, '2010-01-03', '2013-12-31', 48, 4, '2012-10-24', '2012-07-27', '40350000.1130.5088', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '665300.00000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(8, 0, 0, 0, 1, 2, 3, 0, 7, 0, 1, 'Apoyo al sistema de atención médica de emergencia (en la amazonía)', 'EL PROYECTO CONSISTE EN MANTENER UN SISTEMA DE TRASPORTE ADECUADO PARA FACILITAR EL TRASLADO DE EMERGENCIAS DURANTE LAS 24 HORAS A LAS UNIDADES DE  SALUD DE SEGUNDO Y TERCER NIVEL, DENTRO Y FUERA DE LAS PROVINCIAS, ATENDIENDO\nOPORTUNAMENTE A LOS CASOS DE EMERGENCIA, LAS ACTIVIDADES SE REALIZARÁN EN COORDINACIÓN\nDIRECTA CON EL MINISTERIO DE SALUD PÚBLICA', NULL, '2010-01-01', '2011-12-19', 24, 4, '2012-10-24', '2012-07-27', '40350000.1130.5077', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '1316896.14000', NULL, NULL, NULL, NULL, 1, 0, '2013-03-19 11:03:01'),
(9, 0, 0, 0, 1, 2, 3, 0, 9, 0, 1, 'Mejoramiento de la atención de salud a través de la dotación de equipos y medicinas', 'ESTE PROYECTO TRATA DE FORTALECER A LAS UNIDADES OPERATIVAS DE SALUD A TRAVÉS DE LA DOTACIÓN DE EQUIPOS MÉDICOS DETERMINADOS COMO PRIORITARIOS,  DENTIFICADOS MEDIANTE EL  DIAGNÓSTICO Y REQUERIMIENTOS REALIZADOS POR CADA DIRECCIÓN PROVINCIAL DE SALUD DE LA CTEA Y CANALIZADOS AL ECORAE, DE  CONFORMIDAD AL LICENCIAMIENTO\nNORMADO POR EL MINISTERIO DE SALUD, QUE CONSIDERA LA DISPONIBILIDAD DEL PERSONAL TÉCNICO ESPECIALIZADO Y LA INFRAESTRUCTURA DISPONIBLE PARA SU OPERACIÓN Y FUNCIONAMIENTO, ASÍ\nCOMO PARA UNA MEJOR PRESTACIÓN DE LOS SERVICIOS DE SALUD', NULL, '2010-01-04', '2013-12-31', 48, 4, '2012-10-24', '2012-07-30', '40350000.1130.5087', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '213177.70000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(10, 0, 0, 0, 1, 2, 5, 0, 55, 0, 1, 'Fortalecimiento del Programa de acción cívica', 'CON ESTE PROYECTO SE PRETENDE ESTABLECER UN SISTEMA DE TRANSPORTE AÉREO Y FLUVIAL ECONÓMICO SOCIAL, SOLIDARIO Y SOSTENIBLE CONTRIBUYENDO A MITIGAR LAS NECESIDADES DE MOVILIDAD DE LOS HABITANTES DE LAS COMUNIDADES AMAZÓNICAS, QUE  POR SU DIFÍCIL ACCESO TIENEN SERIAS DIFICULTADES DE MOVILIDAD A LAS CENTROS POBLADOS O CAPITALES DE PROVINCIAS PARA SATISFACER SUS NECESIDADES ESPECIALMENTE DE SALUD Y\nPROVISIÓN DE ALIMENTOS. ESTA ACTIVIDAD SE EJECUTARÁ DURANTE LOS CUATRO AÑOS DE DURACIÓN DEL PROYECTO. EL SISTEMA ECONÓMICO AÉREO ESTÁ ORIENTADO A LAS PROVINCIAS DE PASTAZA Y\nMORONA SANTIAGO Y EL FLUVIAL A LA PROVINCIA DE ORELLANA, PARTICULARMENTE AL CANTÓN NUEVO\nROCAFUERTE', NULL, '2010-01-06', '2013-12-06', 47, 4, '2012-10-24', '2012-07-27', '40350000.1130.5090', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '1402984.56000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(11, 0, 0, 0, 1, 2, 5, 0, 8, 5, 1, 'Construcción y mejoramiento de la  infraestructura básica de salud para la CTEA ', 'EL PROYECTO PRETENDE CUBRIR EL DÉFICIT DE PISTAS DE ATERRIZAJE EN LAS PROVINCIAS AMAZÓNICAS, EL CUAL NO PUEDE SER SOLVENTADO POR LAS INSTITUCIONES QUE TIENEN LA COMPETENCIA', NULL, '2010-03-01', '2013-12-31', 45, 4, '2012-10-24', '2012-07-24', '40350000.1131.5078', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '3390705.05000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(30, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'PUENTE CARROZABLE SOBRE EL RIO SAN FRANCISCO PASO A SAN JUAN DEL ORO PARROQUIA SABANILLA', 'EL PROYECTO PRETENDE CUBRIR EL DÉFICIT DE PUENTES EN LA PROVINCIA DE ZAMORA CHINCHIPE, EL CUAL NO PUEDE SER SOLVENTADO POR LAS INSTITUCIONES QUE TIENEN LA COMPETENCIA, COMO SON EL MINISTERIO DE TRANSPORTE Y OBRAS PÚBLICAS -MTOP Y LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS\nDISPONER DE INFRAESTRUCTURA PEATONAL Y CARROZABLE DE ACCESO SEGURO Y ADECUADO, PARA LOS HABITANTES DE LAS COMUNIDADES AISLADAS DE LA PROVINCIA DE ZAMORA CHINCHIPE, MEDIANTE LA CONSTRUCCIÓN DE PUENTES', NULL, '2010-03-01', '2011-12-30', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5274', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '163125.00000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
