(54, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'CONSTRUCCION DE UN PUENTE PEATONAL SOBRE EL RIO OYACACHI', 'EL PROYECTO PRETENDE CUBRIR EL DÉFICIT DE PUENTES EN LA PROVINCIA DE NAPO, DÉFICIT QUE NO PUEDE SER SOLVENTADO POR LAS INSTITUCIONES QUE TIENEN LA COMPETENCIA, COMO SON EL MTOP Y LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS.\nANTE EL DÉFICIT DE LA INFRAESTRUCTURA NECESARIA PARA FACILITAR EL ACCESO DE LAS COMUNIDADES RURALES, EL ECORAE A TRAVÉS DE ESTE PROYECTO SE ENFOCA HACIA LA CONSTRUCCIÓN DE PUENTES MENORES EN ZONAS RURALES, LOS MISMOS QUE SON GESTIONADOS DIRECTAMENTE POR LOS POBLADORES A TRAVÉS DE SU GOBIERNO PARROQUIAL O MUNICIPAL.', NULL, '2011-01-03', '2011-12-30', NULL, 4, '2012-10-24', '2011-08-24', '40350000.1131.5284', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '35061.89000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(55, 0, 0, 0, NULL, 3, 6, 0, 56, 0, 1, 'CONSTRUCCIÓN DE UN PUENTE COLGANTE PEATONAL SOBRE EL RÍO PANO, SECTOR SAN JORGE, CIUDAD DE TENA, CANTÓN TENA, PROVINCIA DE NAPO', 'EL PUENTE SE UBICARÁ EN LA PERIFERIA DE LA CIUDAD DE TENA, UNIENDO AL SECTOR DE SAN JORGE CON UN GRAN SECTOR DE TIERRAS NO OCUPADAS POR LA POBLACIÓN TENA, QUE CORRESPONDEN AL SECTOR LIMITADO POR LOS RÍOS PANO Y TENA, DONDE TAMBIÉN SE UBICA EL PARQUE AMAZÓNICO LA ISLA, QUE ABARCA UNA EXTENSIÓN DE 24  HECTÁREAS.', NULL, '2011-10-31', '2012-12-28', NULL, 4, '2012-10-24', '2012-07-24', '40350000.0000.373639', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '275565.66000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(56, 0, 0, 0, NULL, 3, 6, 0, 56, 0, 1, 'CONSTRUCCION DE UN PUENTE COLGANTE CARROZABLE SOBRE EL RIO MISAHUALLI EN PUERTO MISAHUALLI', 'CON EL FIN DE OPERATIVIZAR EL PROGRAMA DE INFRAESTRUCTURA PARA EL DESARROLLO Y ATENDIENDO LA SOLICITUD PRESENTADA POR REPRESENTANTES DE LAS DISTINTOS CANTONES DE LA PROVINCIA QUE HABITAN EN LAS RIBERAS DE LOS DISTINTOS RÍOS DE LOS 5 CANTONES DE LA PROVINCIA DE NAPO, DURANTE LOS AÑOS 2010 Y 2011, EL ECORAE  CONSTRUIRÁ 11 PUENTES EN ZONAS RURALES Y 7 ESTUDIOS PARA CONSTRUCCIÓN DE PUENTES.\nLA REGIÓN AMAZÓNICA ECUATORIANA PRESENTA UN DÉFICIT DE VÍAS TANTO PRINCIPALES COMO SECUNDARIAS, HASTA EL MOMENTO SE ESTÁ COMPLETANDO LA VÍA PRINCIPAL O TRONCAL AMAZÓNICA, SIN EMBARGO, SU CONSTRUCCIÓN DEJÓ DE LADO LA ELABORACIÓN DE ESTUDIOS PARA LA CONSTRUCCIÓN DE PUENTES, CAUSANDO EL TENER UNA VÍA DE ÓPTIMAS CONDICIONES CON CUELLOS DE BOTELLA ENTRE LOS CANTONES, LAS PARROQUIAS Y COMUNIDADES, QUE CONSTITUYEN UN GRAVE PELIGRO PARA LA CIRCULACIÓN POR LA AUSENCIA DE PUENTES. ESTO EN VÍAS PRINCIPALES, EN VÍAS SECUNDARIAS Y SOBRETODO EN LA ZONA RURAL LA SITUACIÓN ES PEOR, RAZÓN POR LA CUAL EL ECORAE A TRAVÉS DEL PRESENTE PROYECTO PRETENDE CONTRIBUIR A PALIAR ESTA SITUACIÓN, SIN DUPLICAR FUNCIONES NI ATRIBUCIONES DEL MINISTERIO DE TRANSPORTE Y OBRAS PÚBLICAS NI DE LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS', NULL, '2011-01-03', '2011-12-30', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5288', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '0.00000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
