(61, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'CONSTRUCCION DE UN PUENTE COLGANTE CARROZABLE SOBRE EL RIO TENA SECTOR SAN PEDRO', 'EL PROYECTO PRETENDE CUBRIR EL DÉFICIT DE PUENTES EN LA PROVINCIA DE NAPO, DÉFICIT QUE NO PUEDE SER SOLVENTADO POR LAS INSTITUCIONES QUE TIENEN LA COMPETENCIA, COMO SON EL MTOP Y LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS. \nANTE EL DÉFICIT DE LA INFRAESTRUCTURA NECESARIA PARA FACILITAR EL ACCESO DE LAS COMUNIDADES RURALES, EL ECORAE A TRAVÉS DE ESTE PROYECTO SE ENFOCA HACIA LA CONSTRUCCIÓN DE PUENTES MENORES EN ZONAS RURALES, LOS MISMOS QUE SON GESTIONADOS DIRECTAMENTE POR LOS POBLADORES A TRAVÉS DE SU GOBIERNO PARROQUIAL O MUNICIPAL.', NULL, '2010-03-01', '2011-12-30', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5246', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '193457.31000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(62, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'CONSTRUCCION DE UN PUENTE COLGANTE CARROZABLE SOBRE EL RIO JATUNYACU EN LA COMUNIDAD DE SHANDIA', 'CON EL FIN DE OPERATIVIZAR EL PROGRAMA DE INFRAESTRUCTURA PARA EL DESARROLLO Y ATENDIENDO LA SOLICITUD PRESENTADA POR REPRESENTANTES DE LAS DISTINTOS CANTONES DE LA PROVINCIA QUE HABITAN EN LAS RIBERAS DE LOS DISTINTOS RÍOS DE LOS 5 CANTONES DE LA PROVINCIA DE NAPO, DURANTE LOS AÑOS 2010 Y 2011, EL ECORAE CONSTRUIRÁ 11 PUENTES EN ZONAS RURALES Y 7 ESTUDIOS PARA CONSTRUCCIÓN DE PUENTES.\nLA REGIÓN AMAZÓNICA ECUATORIANA PRESENTA UN DÉFICIT DE VÍAS TANTO PRINCIPALES COMO SECUNDARIAS, HASTA EL MOMENTO SE ESTÁ COMPLETANDO LA VÍA PRINCIPAL O TRONCAL AMAZÓNICA, SIN EMBARGO, SU CONSTRUCCIÓN DEJÓ DE LADO LA ELABORACIÓN DE ESTUDIOS PARA LA CONSTRUCCIÓN DE PUENTES, CAUSANDO EL TENER UNA VÍA DE ÓPTIMAS CONDICIONES CON CUELLOS DE BOTELLA ENTRE LOS CANTONES, LAS PARROQUIAS Y COMUNIDADES, QUE CONSTITUYEN UN GRAVE PELIGRO PARA LA CIRCULACIÓN POR LA AUSENCIA DE PUENTES. ESTO EN VÍAS PRINCIPALES, EN VÍAS SECUNDARIAS Y SOBRETODO EN LA ZONA RURAL LA SITUACIÓN ES PEOR, RAZÓN POR LA CUAL EL ECORAE A TRAVÉS DEL PRESENTE PROYECTO PRETENDE CONTRIBUIR A PALIAR ESTA SITUACIÓN, SIN\nDUPLICAR FUNCIONES NI ATRIBUCIONES DEL MINISTERIO DE TRANSPORTE Y OBRAS PÚBLICAS NI DE LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS', NULL, '2010-06-01', '2011-12-30', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5287', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '100065.35000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
