(70, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'ESTUDIOS PARA LA CONSTRUCCION DE UN PUENTE SOBRE EL RIO HOLLIN EN EL SECTOR MOLINO', 'CON EL FIN DE OPERATIVIZAR EL PROGRAMA DE INFRAESTRUCTURA PARA EL DESARROLLO Y ATENDIENDO LA SOLICITUD PRESENTADA POR REPRESENTANTES DE LAS DISTINTOS CANTONES DE LA PROVINCIA QUE HABITAN EN LAS RIBERAS DE LOS DISTINTOS RÍOS DE LOS 5 CANTONES DE LA PROVINCIA DE NAPO, DURANTE LOS AÑOS 2010 Y 2011, EL ECORAE CONSTRUIRÁ 11 PUENTES EN ZONAS RURALES Y 7 ESTUDIOS PARA CONSTRUCCIÓN DE PUENTES.\nLA REGIÓN AMAZÓNICA ECUATORIANA PRESENTA UN DÉFICIT DE VÍAS TANTO PRINCIPALES COMO SECUNDARIAS, HASTA EL MOMENTO SE ESTÁ COMPLETANDO LA VÍA PRINCIPAL O TRONCAL AMAZÓNICA, SIN EMBARGO, SU CONSTRUCCIÓN DEJÓ DE LADO LA ELABORACIÓN DE ESTUDIOS PARA LA CONSTRUCCIÓN DE PUENTES, CAUSANDO EL TENER UNA VÍA DE ÓPTIMAS CONDICIONES CON CUELLOS DE BOTELLA ENTRE LOS CANTONES, LAS PARROQUIAS Y COMUNIDADES, QUE CONSTITUYEN UN GRAVE PELIGRO PARA LA CIRCULACIÓN POR LA AUSENCIA DE PUENTES. ESTO EN VÍAS PRINCIPALES, EN VÍAS SECUNDARIAS Y SOBRETODO EN LA ZONA RURAL LA SITUACIÓN ES PEOR, RAZÓN POR LA CUAL EL ECORAE A TRAVÉS DEL PRESENTE PROYECTO PRETENDE CONTRIBUIR A PALIAR ESTA SITUACIÓN, SIN DUPLICAR FUNCIONES NI ATRIBUCIONES DEL MINISTERIO DE TRANSPORTE Y OBRAS PÚBLICAS NI DE LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS', NULL, '2010-06-01', '2010-12-31', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5290', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '9000.00000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(71, 0, 0, 0, 7, 3, 6, 0, 56, 0, 1, 'PUENTES EMERGENCIA NAPO', 'EL 06 DE ABRIL DEL 2010, EN LA PROVINCIA DE NAPO SE DESBORDARON LOS RÍOS MISAHUALLÍ, TENA, LUSHIAN Y PANO, CAUSANDO PÉRDIDAS EN CUANTO A INFRAESTRUCTURA SE REFIERE Y PÉRDIDAS CUANTIOSAS DE ENSERES PERSONALES DE LA POBLACIÓN DE TENA.MEDIANTE RESOLUCIÓN EJECUTIVA NO. 90 DE FECHA 11 DE MAYO DEL 2010, EL ECORAE RESUELVE ATENDER LA EMERGENCIA EN NAPO Y DAR CUMPLIMIENTO A UNO DE LOS COMPROMISOS PRESIDENCIALES EN LO REFERENTE A LOS PUENTES AFECTADOS POR LAS INUNDACIONES. EL PROYECTO ¿PUENTES EMERGENCIA NAPO¿ COMPRENDE LA CONSTRUCCIÓN DE 6 PUENTES Y LA ELABORACIÓN DE 14 ESTUDIOS.?\nEN BASE A LO MENCIONADO, EL 08 DE ABRIL DEL 2010, MEDIANTE DECRETO NO.317 SE ESTABLECE EL ESTADO DE EMERGENCIA ¿DECLÁRESE EL ESTADO DE EXCEPCIÓN POR LA RIGUROSA ESTACIÓN INVERNAL QUE AFECTA PRINCIPALMENTE A LOS CANTONES DE TENA, ARCHIDONA Y AROSEMENA TOLA DE LA PROVINCIA DE NAPO, CON EL OBJETO DE MITIGAR Y PREVENIR LOS IMPACTOS DE LAS INUNDACIONES Y DESLIZAMIENTOS, QUE AMENAZAN LA SUPERVIVENCIA DE LA POBLACIÓN Y HAN PROVOCADO LA DESTRUCCIÓN DE LA INFRAESTRUCTURA AGROPECUARIA Y PRODUCTIVA DE DICHOS CANTONES GENERANDO UN ALTO RIESGO DE CONMOCIÓN INTERNA EN ESE TERRITORIO.', NULL, '2010-04-06', '2012-04-03', NULL, 4, '2012-10-24', '2012-04-03', '40350000.1131.6386', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '4720462.06000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00'),
(72, 0, 0, 0, 6, 3, 6, 0, 56, 0, 1, 'ESTUDIOS PARA LA CONSTRUCCION DE UN PUENTE SOBRE EL RIO MISAHUALLI COMUNIDAD CALMITOYACU CANTON ARCHIDONA', 'CON EL FIN DE OPERATIVIZAR EL PROGRAMA DE INFRAESTRUCTURA PARA EL DESARROLLO Y ATENDIENDO LA SOLICITUD PRESENTADA POR REPRESENTANTES DE LAS DISTINTOS CANTONES DE LA PROVINCIA QUE HABITAN EN LAS RIBERAS DE LOS DISTINTOS RÍOS DE LOS 5 CANTONES DE LA PROVINCIA DE NAPO, DURANTE LOS AÑOS 2010 Y 2011, EL ECORAE CONSTRUIRÁ 11 PUENTES EN ZONAS RURALES Y 7 ESTUDIOS PARA CONSTRUCCIÓN DE PUENTES.\nLA REGIÓN AMAZÓNICA ECUATORIANA PRESENTA UN DÉFICIT DE VÍAS TANTO PRINCIPALES COMO SECUNDARIAS, HASTA EL MOMENTO SE ESTÁ COMPLETANDO LA VÍA PRINCIPAL O TRONCAL AMAZÓNICA, SIN EMBARGO, SU CONSTRUCCIÓN DEJÓ DE LADO LA ELABORACIÓN DE ESTUDIOS PARA LA CONSTRUCCIÓN DE PUENTES, CAUSANDO EL TENER UNA VÍA DE ÓPTIMAS CONDICIONES CON CUELLOS DE BOTELLA ENTRE LOS CANTONES, LAS PARROQUIAS Y COMUNIDADES, QUE CONSTITUYEN UN GRAVE PELIGRO PARA LA CIRCULACIÓN POR LA AUSENCIA DE PUENTES. ESTO EN VÍAS PRINCIPALES, EN VÍAS SECUNDARIAS Y SOBRETODO EN LA ZONA RURAL LA SITUACIÓN ES PEOR, RAZÓN POR LA CUAL EL ECORAE A TRAVÉS DEL PRESENTE PROYECTO PRETENDE CONTRIBUIR A PALIAR ESTA SITUACIÓN, SIN DUPLICAR FUNCIONES NI ATRIBUCIONES DEL MINISTERIO DE TRANSPORTE Y OBRAS PÚBLICAS NI DE LOS GOBIERNOS DESCENTRALIZADOS AUTÓNOMOS', NULL, '2011-01-03', '2011-12-30', NULL, 4, '2012-10-24', '2012-10-24', '40350000.1131.5291', 'CARLOS VITERI GUALINGA', 'SECRETARIO EJECUTIVO', '15191.24000', NULL, NULL, NULL, NULL, 1, 0, '0000-00-00 00:00:00');
