INSERT INTO `tb_pnd_politica_nacional` (`intCodigo_pn`, `intCodigo_on`, `intCodigo_pln`, `strDescripcion_pln`, `published`, `checked_out`, `checked_out_time`) VALUES
(1, 1, 1, 'Garantizar los derechos del Buen Vivir para la superación de todas las desigualdades en especial salud, educación, alimentación, agua y vivienda', 1, 0, '0000-00-00 00:00:00'),
(1, 1, 2, 'Impulsar la protección social integral y seguridad social solidaria de la población con calidad y eficiencia a lo largo de la vida con principios de igualdad, justicia, dignidad, interculturalidad', 1, 0, '0000-00-00 00:00:01'),
(1, 1, 3, 'Promover la inclusión social y económica con enfoque de género, intercultural e intergeneracional para generar condiciones de equidad', 1, 0, '0000-00-00 00:00:02'),
(1, 1, 4, 'Democratizar los medios de producción para generar condiciones y oportunidades equitativas', 1, 0, '0000-00-00 00:00:03'),
(1, 1, 5, 'Asegurar la redistribución solidaria y equitativa de la riqueza', 1, 0, '0000-00-00 00:00:04'),
(1, 1, 6, 'Reconocer y respetar las diversidades socioculturales y erradicar toda forma de discriminación, sea ésta por motivos de género, de opción sexual, étnico-culturales, políticos, económicos, religiosos, de origen, migratorios, geográficos, etáreos, de condición socioeconómica, condición de discapacidad u otros.', 1, 0, '0000-00-00 00:00:05'),
(1, 1, 7, 'Proteger y promover los derechos de las y los ecuatorianos en el exterior y de las y los extranjeros en el Ecuador y de sus diversas formas de familia', 1, 0, '0000-00-00 00:00:06'),
(1, 1, 8, 'Impulsar el Buen Vivir rural ', 1, 0, '0000-00-00 00:00:07'),
(1, 1, 9, 'Promover el ordenamiento territorial integral, equilibrado, equitativo y sustentable que favorezca la formación de una estructura nacional policéntrica', 1, 0, '0000-00-00 00:00:08'),
(1, 1, 10, 'Asegurar el desarrollo infantil integral para el ejercicio pleno de derechos', 1, 0, '0000-00-00 00:00:09'),
(1, 2, 1, 'Asegurar una alimentación sana, nutritiva, natural y con productos del medio para disminuir drásticamente las deficiencias nutricionales', 1, 0, '0000-00-00 00:00:10'),
(1, 2, 2, 'Mejorar progresivamente la calidad de la educación, con un enfoque de derechos, de género, intercultural e inclusiva, para fortalecer la unidad en la diversidad e impulsar la permanencia en el sistema educativo y la culminación de los estudios', 1, 0, '0000-00-00 00:00:11'),
(1, 2, 3, 'Fortalecer la educación intercultural bilingüe y la interculturalización de la educación', 1, 0, '0000-00-00 00:00:12'),
(1, 2, 4, 'Generar procesos de capacitación y formación continua para la vida, con enfoque de género, generacional e intercultural articulados a los objetivos del Buen Vivir', 1, 0, '0000-00-00 00:00:13'),
(1, 2, 5, 'Fortalecer la educación superior con visión científica y humanista, articulada a los objetivos para el Buen Vivir', 1, 0, '0000-00-00 00:00:14'),
(1, 2, 6, 'Promover la investigación y el conocimiento científico, la revalorización de conocimientos y saberes ancestrales, y la innovación tecnológica', 1, 0, '0000-00-00 00:00:15'),
(1, 2, 7, 'Promover el acceso a la información y a las nuevas tecnologías de la información y comunicación para incorporar a la población a la sociedad de la información y fortalecer el ejercicio de la ciudadanía', 1, 0, '0000-00-00 00:00:16'),
(1, 2, 8, 'Promover el deporte y las actividades físicas como un medio para fortalecer las capacidades y potencialidades de la población', 1, 0, '0000-00-00 00:00:17'),
(1, 3, 1, 'Promover prácticas de vida saludable en la población', 1, 0, '0000-00-00 00:00:18'),
(1, 3, 2, 'Fortalecer la prevención, el control y la vigilancia de la enfermedad, y el desarrollo de capacidades para describir, prevenir y controlar la morbilidad', 1, 0, '0000-00-00 00:00:19'),
(1, 3, 3, 'Garantizar la atención integral de salud por ciclos de vida, oportuna y sin costo para las y los usuarios, con calidad, calidez y equidad', 1, 0, '0000-00-00 00:00:20'),
(1, 3, 4, 'Brindar atención integral a las mujeres y a los grupos de atención prioritaria, con enfoque de género, generacional, familiar, comunitario e intercultural', 1, 0, '0000-00-00 00:00:21'),
(1, 3, 5, 'Reconocer, respetar y promover las prácticas de medicina ancestral y alternativa y el uso de sus conocimientos, medicamentos e instrumentos', 1, 0, '0000-00-00 00:00:22'),
(1, 3, 6, 'Garantizar vivienda y hábitat dignos, seguros y saludables, con equidad, sustentabilidad y eficiencia', 1, 0, '0000-00-00 00:00:23'),
(1, 3, 7, 'Propiciar condiciones de seguridad humana y confianza mutua entre las personas en los diversos entornos', 1, 0, '0000-00-00 00:00:24'),
(1, 4, 1, 'Conservar y manejar sustentablemente el patrimonio natural y su biodiversidad terrestre y marina, considerada como sector estratégico', 1, 0, '0000-00-00 00:00:25'),
(1, 4, 2, 'Manejar el patrimonio hídrico con un enfoque integral e integrado por cuenca hidrográfica, de aprovechamiento estratégico del Estado y de valoración sociocultural y ambiental', 1, 0, '0000-00-00 00:00:26'),
(1, 4, 3, 'Diversificar la matriz energética nacional, promoviendo la eficiencia y una mayor participación de energías renovables sostenibles', 1, 0, '0000-00-00 00:00:27'),
(1, 4, 4, 'Prevenir, controlar y mitigar la contaminación ambiental como aporte para el mejoramiento de la calidad de vida', 1, 0, '0000-00-00 00:00:28'),
(1, 4, 5, 'Fomentar la adaptación y mitigación a la variabilidad climática con énfasis en el proceso de cambio climático', 1, 0, '0000-00-00 00:00:29'),
(1, 4, 6, 'Reducir la vulnerabilidad social y ambiental ante los efectos producidos por procesos naturales y antrópicos generadores de riesgos', 1, 0, '0000-00-00 00:00:30'),
(1, 4, 7, 'Incorporar el enfoque ambiental en los procesos sociales, económicos y culturales dentro de la gestión pública', 1, 0, '0000-00-00 00:00:31'),
(1, 5, 1, 'Ejercer la soberanía y promover la convivencia pacífica de las personas en una cultura de paz', 1, 0, '0000-00-00 00:00:32'),
(1, 5, 2, 'Defender la integridad territorial y los derechos soberanos del Estado', 1, 0, '0000-00-00 00:00:33'),
(1, 5, 3, 'Propender a la reducción de la vulnerabilidad producida por la dependencia externa alimentaria y energética', 1, 0, '0000-00-00 00:00:34'),
(1, 5, 4, 'Promover el diálogo político y la negociación soberana de la cooperación y de los instrumentos económicos', 1, 0, '0000-00-00 00:00:35'),
(1, 5, 5, 'Impulsar la integración con América Latina y el Caribe', 1, 0, '0000-00-00 00:00:36'),
(1, 5, 6, 'Promover relaciones exteriores soberanas y estratégicas, complementarias y solidarias', 1, 0, '0000-00-00 00:00:37'),
(1, 5, 7, 'Combatir la delincuencia transnacional organizada en todas sus manifestaciones', 1, 0, '0000-00-00 00:00:38'),
(1, 6, 1, 'Valorar todas las formas de trabajo, generar condiciones dignas para el trabajo y velar por el cumplimiento de los derechos laborales', 1, 0, '0000-00-00 00:00:39'),
(1, 6, 2, 'Impulsar el reconocimiento del trabajo autónomo, de cuidado humano, de cuidado familiar y de autoconsumo, así como la transformación integral de sus condiciones', 1, 0, '0000-00-00 00:00:40'),
(1, 6, 3, 'Fomentar la asociatividad como base para mejorar las condiciones de trabajo, así como para crear nuevos empleos', 1, 0, '0000-00-00 00:00:41'),
(1, 6, 4, 'Promover el pago de remuneraciones justas sin discriminación alguna, propendiendo a la reducción de la brecha entre el costo de la canasta básica y el salario básico', 1, 0, '0000-00-00 00:00:42'),
(1, 6, 5, 'Impulsar actividades económicas que conserven empleos y fomenten la generación de nuevas plazas, así como la disminución progresiva del subempleo y desempleo ', 1, 0, '0000-00-00 00:00:43'),
(1, 6, 6, 'Promover condiciones y entornos de trabajo seguro, saludable, incluyente, no discriminatorio y ambientalmente amigable', 1, 0, '0000-00-00 00:00:44'),
(1, 6, 7, 'Impulsar procesos de capacitación y formación para el trabajo ', 1, 0, '0000-00-00 00:00:45'),
(1, 6, 8, 'Crear condiciones para la reinserción laboral y productiva de la población migrante que retorna al Ecuador, y proteger a las y los trabajadores en movilidad', 1, 0, '0000-00-00 00:00:46'),
(1, 7, 1, 'Garantizar a la población el derecho al acceso y al disfrute de los espacios públicos en igualdad de condiciones', 1, 0, '0000-00-00 00:00:47'),
(1, 7, 2, 'Promocionar los deberes y derechos respecto al uso de los espacios públicos', 1, 0, '0000-00-00 00:00:48'),
(1, 7, 3, 'Fomentar y optimizar el uso de espacios públicos para la práctica de actividades culturales, recreativas y deportivas', 1, 0, '0000-00-00 00:00:49'),
(1, 7, 4, 'Democratizar la oferta y las expresiones culturales diversas, asegurando la libre circulación, reconocimiento y respeto a las múltiples identidades sociales', 1, 0, '0000-00-00 00:00:50'),
(1, 7, 5, 'Impulsar el fortalecimiento y apertura de espacios públicos permanentes de intercambio entre grupos diversos que promuevan la interculturalidad, el reconocimiento mutuo y la valorarización de todas las expresiones colectivas', 1, 0, '0000-00-00 00:00:51'),
(1, 7, 6, 'Garantizar a la población el ejercicio del derecho a la comunicación libre, intercultural, incluyente, responsable, diversa y participativa', 1, 0, '0000-00-00 00:00:52'),
(1, 7, 7, 'Garantizar el derecho al disfrute pleno de la ciudad y de sus espacios públicos, bajo principios de sustentabilidad, justicia social, equidad de género y respeto cultural', 1, 0, '0000-00-00 00:00:53'),
(1, 7, 8, 'Mejorar los niveles de seguridad en los espacios públicos', 1, 0, '0000-00-00 00:00:54'),
(1, 8, 1, 'Apoyar la construcción de la sociedad plurinacional e intercultural dentro de relaciones de reconocimiento de la diferencia y respeto mutuo, bajo los principios del Buen Vivir', 1, 0, '0000-00-00 00:00:55'),
(1, 8, 2, 'Superar las desigualdades sociales y culturales garantizando el acceso universal de toda persona o colectividad a participar y beneficiarse de los diversos bienes y expresiones culturales', 1, 0, '0000-00-00 00:00:56'),
(1, 8, 3, 'Impulsar el conocimiento, la valoración y afirmación de las diversas identidades socioculturales de los distintos pueblos y nacionalidades que conforman el Ecuador, así como la de las y los ecuatorianos que se encuentran residiendo fuera del país, en atención al fortalecimiento de la identidad ecuatoriana.', 1, 0, '0000-00-00 00:00:57'),
(1, 8, 4, 'Impulsar y apoyar procesos de creación cultural en todas sus formas, lenguajes y expresiones, tanto de individuos como de grupos y comunidades', 1, 0, '0000-00-00 00:00:58'),
(1, 8, 5, 'Promover y apoyar procesos de preservación, valoración, fortalecimiento, control y difusión de las memoria colectiva e individual y del patrimonio cultural y natural del país, en toda su riqueza y diversidad', 1, 0, '0000-00-00 00:00:59'),
(1, 9, 1, 'Aplicar y practicar el pluralismo jurídico, respetando los derechos constitucionales', 1, 0, '0000-00-00 00:00:00'),
(1, 9, 2, 'Promover un ordenamiento jurídico acorde al carácter plurinacional del Estado constitucional de derechos y justicia ', 1, 0, '0000-00-00 00:00:00'),
(1, 9, 3, 'Impulsar una administración de justicia independiente, eficiente, eficaz, oportuna, imparcial, adecuada e integral', 1, 0, '0000-00-00 00:00:00'),
(1, 9, 4, 'Erradicar las prácticas de violencia contra las personas, pueblos y nacionalidades', 1, 0, '0000-00-00 00:00:00'),
(1, 9, 5, 'Impulsar un sistema de rehabilitación social que posibilite el ejercicio de derechos y responsabilidades de las personas privadas de la libertad', 1, 0, '0000-00-00 00:00:00'),
(1, 9, 6, 'Promover el conocimiento y procesos de formación jurídica para la población', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 1, 'Promover la organización colectiva y autónoma de la sociedad civil', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 2, 'Fortalecer, generar e innovar formas de control social y rendición de cuentas a las y los mandantes', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 3, 'Promover la participación política y electoral con equidad en los cargos de elección popular, de designación y en las instituciones públicas', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 4, 'Garantizar el libre acceso a información pública oportuna', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 5, 'Promover el desarrollo estadístico y cartográfico, para la generación de información de calidad', 1, 0, '0000-00-00 00:00:00'),
(1, 10, 6, 'Promover procesos sostenidos de formación ciudadana reconociendo las múltiples diversidades', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 1, 'Impulsar una economía endógena para el buen vivir, sostenible y territorialmente equilibrada, que propenda a la garantía de derechos y a la transformación, diversificación y especialización productiva a partir del fomento a las diversas formas de producción.', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 2, 'Impulsar la actividad de pequeñas y medianas unidades económicas asociativas y fomentar la demanda de los bienes y servicios que generan', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 3, 'Impulsar las condiciones productivas necesarias para el logro de la soberanía alimentaria', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 4, 'Impulsar el desarrollo soberano de los sectores estratégicos en el marco de un aprovechamiento ambiental y socialmente responsable de los recursos no renovables', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 5, 'Fortalecer y ampliar la cobertura de infraestructura básica y de servicios públicos para extender las capacidades y oportunidades económicas', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 6, 'Diversificar los mecanismos para los intercambios económicos, promover esquemas justos de precios y calidad para minimizar las distorsiones de la intermediación, y privilegiar la complementariedad y la solidaridad', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 7, 'Promover condiciones adecuadas para el comercio interno e internacional, considerando especialmente sus interrelaciones con la producción y con las condiciones de vida', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 8, 'Identificar, controlar y sancionar las prácticas de competencia desleales, y toda violación a los derechos económicos y a los bienes públicos y colectivos para fomentar la igualdad de condiciones y oportunidades en los mercados', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 9, 'Promover el acceso a conocimientos y tecnologías y a su generación endógena como bienes públicos', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 10, 'Promover cambios en los patrones de consumo, a fin de reducir su componente importado y suntuario, generalizar hábitos saludables y prácticas solidarias, social y ambientalmente responsables', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 11, 'Promover la sostenibilidad ecosistémica de la economía a través la implementación de tecnologías y prácticas de producción limpia', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 12, 'Propender hacia la sostenibilidad macroeconómica fortaleciendo al sector público en sus funciones económicas de planificación, redistribución, regulación y control', 1, 0, '0000-00-00 00:00:00'),
(1, 11, 13, 'Promover el ahorro y la inversión nacionales, consolidando el sistema financiero como servicio de orden público, con un adecuado funcionamiento y complementariedad entre sus sectores público, privado y popular solidario', 1, 0, '0000-00-00 00:00:00'),
(1, 12, 1, 'Construir el Estado plurinacional e intercultural para el Buen Vivir', 1, 0, '0000-00-00 00:00:00'),
(1, 12, 2, 'Consolidar la nueva organización y rediseño institucional del Estado que recupere las capacidades estatales de rectoría, planificación, regulación, control, investigación y participación', 1, 0, '0000-00-00 00:00:00'),
(1, 12, 3, 'Consolidar el modelo de gestión estatal articulado que profundice los procesos de descentralización y desconcentración y que promueva el desarrollo territorial equilibrado', 1, 0, '0000-00-00 00:00:00'),
(1, 12, 4, 'Fomentar un servicio público eficiente y competente', 1, 0, '0000-00-00 00:00:00'),
